import React from "react";

function ThemeSwitcher({ onChange }) {
  return (
    <ul>
      <li>
        <button value={"light"} onClick={e => onChange(e.currentTarget.value)}>
          Light
        </button>
      </li>
      <li>
        <button value={"dark"} onClick={e => onChange(e.currentTarget.value)}>
          Dark
        </button>
      </li>
      <li>
        <button value={"darker"} onClick={e => onChange(e.currentTarget.value)}>
          Darker
        </button>
      </li>
    </ul>
  );
}

export default ThemeSwitcher;
